import React from "react";
import logo from "./logo.svg";
import card from "./card.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>
      <hr />

      <p>
        My name is Sita Robinson. I am a Senior Data Science major at Drexel
        University with a minor in Computer Science. I am expected to graduate
        with my Bachelors degree in 2020. I am the president of Drexel Women in
        Computing Society (WiCS). Previously I was treasurer of WiCS for two
        years. My last job was in a data science co-op (6 month internship) at
        ELAP Services in Chesterbrook, Pennsylvania. In the summer of 2017, I
        was a Software Engineering Intern at Comcast in Philadelphia. Some of my
        hobbies include programming, photography, playing the clarinet, playing
        Scrabble and traveling around the world. I am originally a Northern
        Virginia/Metro D.C. native.
      </p>
    </div>
  );
}

export default App;
